Coef_name = {'log scale_h','F_h ', 'F_f','delta','log scale_f','beta','a_h','b_h','L_z','D_z','L_b','gamma','cs_f','sig_p'};
parameter   = zeros(14,1);
parameter(1) =  scale_h; % log of home profit function scalar       
parameter(2) =  F_h;     % home match fixed cost
parameter(3) =  F_f;     % foreign match fixed cost
parameter(4) =  delta;   % exogenous match death hazard (per year)        
parameter(5) =  scale_f; % log of foreign profit function scalar       
parameter(6) =  beta;    % cost function convexity parameter               
parameter(7) =  ah;      % success rate distribution parameter
parameter(8) =  bh;      % success rate distribution parameter
parameter(9) =  L_z;     % buyer shock jump hazard            
parameter(10) = D_z;     % buyer shock jump size            
parameter(11) = L_b;     % shipment hazard            
parameter(12) = gam;     % network effect
parameter(13) = cs_f;    % cost function scalar          
parameter(14) = sig_p;   % std. dev. of log productivity shock

t_ratio  = parameter./std_error;
format short
Structural_estimates = table(parameter,std_error,t_ratio,'RowNames',Coef_name)